insert  into `kritik_biro`(`periode_kode`,`kritik`) values ('20131','Kalau bisa pada saat mau frs nilai itu sdh keluar semua\r\nSehingga mahasiswa tidak repot2 meminta transkrip ke baak'),('20131','mohon di tingkatkan'),('20131','Tidak ada'),('20131','Poin mahasiswa terlalu lama untuk dicatat dalam SIM dari tanggal kegiatan dilaksanakan. Nilai akhir mata kuliah juga ada beberapa yang tidak muncul di SIM sampai dengan perwalian semester baru lewat, seharusnya ada batas waktu tanggal deadline kapan nilai harus muncul setiap semesternya.'),('20131','Pelayanan kurang ramah...\r\nApakah semua dosen sudah tau peraturan yang ada di iSTTS?\r\n(Dosen tetap maupun dosen tidak tetap)'),('20131','Saya memohon untuk pengurusan masalah surat keterangan di BAA Lantai II/Atas untuk mahasiswa agar tepat waktu. kemarin saya meminta mengajukan surat keterangan Mahasiswa  katanya sesuai prosedurnya selesai dalam 3 Hari, Ternyata kemarin selesai dalam waktu 4 Hari. itupun dalam hari keempat sempat menunggu dan belum ditandatangani oleh Bapak Rektor. sekian dan terimakasih.'),('20131','untuk semuanya alangkah baiknya lebih ramah.'),('20131','tidak ada'),('20131','Lebih banyak senyum untuk melayani para mahasiswa (jangan menampakkan wajah cutek)'),('20131','Tidak ada kritik'),('20131','Gak ada...'),('20131','HARAP DIBERI PERINGATAN TEGAS BAGI ORANG-ORANG YANG MEROKOK DIGEDUNG B'),('20131','  pertahankan!'),('20131','Tolong diperbaiki untuk bagian keuangan beasiswa dan juga keuangan (untuk debit uang sekolah), karena sering terjadi kelebihan pendebitan uang sekolah dikarenakan beasiswa belum turun.\r\n\r\nDan saat ini uang sekolah belum juga didebit dikarenakan beasiswa belum turun, mohon segera dilakukan tindakan.\r\n\r\nMohon dipertimbangkan untuk kepala laboratorium jangan dipusatkan pada satu dosen saja, tolong dipertimbangkan agar masing-masing lab mempunyai kepala lab masing-masing, sehingga dosen tersebut dapat lebih terfokus.'),('20131','siip'),('20131','cukup'),('20131','Pengeluaran beasiswa tidak pernah tepat waktu sehingga penarikan uang sekolah selalu lebih dari yang seharusnya. Hal ini sudah berulang dari saya semester 2 hingga semester 5. Ibu BAU bawah dengan enaknya bilang \"ya untuk uang sekolahmu semester depan kan, kan kamu masih kuliah di sini\". Iya kalau saya mau nglanjutin di STTS, kalau tidak? Yang kelebihan diambil adalah uang jajan saya, apakah saya jadi tidak makan karena mengutangi kampus? Apakah mama saya mbelani ngasih uang jajan lagi hanya karena yang sudah terkirim diambil kampus? Semester ini juga uang sekolah saya tidak didebet karena alasannya beasiswanya belum dihitung. Pada saat di telp, ibu BAU hanya berkata \"ya ibu nanti transfer ke sini, kalau sudah transfer nanti ibu telp sini lagi bilang kalau sudah transfer, kan perwaliannya masih lama\" Yang salah ini siapa, kenapa saya yang direpotkan dan masih bisa dengan enaknya bilang \"nanti ibu telp sini lagi kabarin saya\". Saya telp hari Kamis dan perwalian awal jadwalnya hari Selasa, itu masih lama? Saya telusuri ternyata ibu BAU bilang kemahasiswaan yang belum mengeluarkan besasiswa karena semuanya sibuk keluar kota mengurus PMB. Padahal beasiswa saya ini sudah pasti, beasiswa PMB yang syaratnya IPS 3 ke atas, hal ini kan sudah bisa dipastikan sejak nilai keluar, harusnya bisa langsung dikeluarkan beasiswanya. Saya sudah urus persyaratan beasiswa sejak hari pertama kuliah semester lalu yaitu bulan September, ternyata beasiswa itu belum diurus hingga pendebetan Februari, ini sudah berapa bulan? 6 BULAN!!! Dan seenaknya masih menyusahkan pihak mahasiswa masih harus telp lagi, untung mahasiswa ngecek kalau belum didebet, kalau tidak jangan-jangan nanti didenda karena tidak bisa perwalian karena belum bayar? Tabungan saya ada isinya, tapi siapa yang tidak mendebet. Padahal dulu semester 1 disuruh buat tabungan untuk didebet, untuk apa tabungan itu kalau ternyata tidak didebet? Apakah sistem kampus ini kalau mahasiswa sudah terlanjur masuk ya sudah tidak diurus mahasiswanya, malah sibuk keluar kota mengurus PMB semua? Jadi menjaga kesejahteraan mahasiswa yang sudah terdaftar itu menjadi prioritas terakhir dan prioritas utamanya adalah mencari mahasiswa baru terus? Hal ini sudah berlangsung dari saya semester 2 hingga semester 5, sudah 2 tahun tidak ada pembenaran sama sekali. Saya sangat kecewa setiap semester selalu urusannya BAU terus, dan ibu BAU itu kalau bicara enak sekali semau sendiri. Saya ini belajar rajin demi IP agar dapat beasiswa membantu ortu, saya ini berhak dapat beasiswa, mana hak saya dari STTS? Mana kewajibannya STTS memberi beasiswa elektro putri yang sudah dipamer-pamerkan sejak sebelum saya masuk STTS? Kalau memang kurang tulus memberi beasiswa ya jangan digembor-gemborkan gitu lho..'),('20131','sudah cukup baik'),('20131','dalam memasukan poin kurang teliti'),('20131','perpustakaan kurang diminati'),('20131','Sebaiknya ditingkatkan lagi BAA, management waktu kurang\r\n'),('20131','semoga dalam administrasi keuangan dapat lancar dan tidak terkendala'),('20131','saya beri nilai cukup karena belum pernah mengunjungi bagian yang ditanyakan....'),('20131','Pelayanannya sudah cukup baik'),('20131','KANTIN STTS KURANG BESAR\r\n'),('20131','\r\nPerbaikan pelayanan ditingkatkan'),('20131','Lebih baik diperhatikan pada bidang profesionalitas dan tidak terbawa pada masalah pribadi'),('20131','sejauh ini masih dapat dimaklumi'),('20131','cukup'),('20131','tidak ada'),('20131','Tolong di bantu untuk apresiasi mahasiswa desain untuk pengenalan diri lewat pameran di luar kampus iSTTS.'),('20131','Sudah cukup'),('20131','cukup baik, tidak ada yang dikeluhkan'),('20131','untuk pengumuman yang ada dimading ttg pembatalan jadwal kuliah selisih waktu kuliah dan pengumumanya cma 1 jam bahkan da yg brusn ditempel pd wktu jam kuliah.'),('20131','Wifi di perpustakaan E sinyalnya lemah dan sering hilang\r\nGedung B bawah banyak asap rokok membuat gk nyaman'),('20131','Wifi di perpustakaan E sinyalnya lemah dan sering hilang\r\nGedung B bawah banyak asap rokok membuat gk nyaman'),('20131','Tempat terkesan pengap, kotor, dan gelap.'),('20131','Agar bisa memperhatikan hal-hal yang masih kurang,walaupun sekecil apapun'),('20131','Banyak asisten lab yang masih jelek.'),('20131','di bau terlalu banyak mahasiswa yang nongkrong tidak jelas sehingga membuat orang sungkan untuk masuk BAU bawah. '),('20131','tolong sistemnya di perjelas\r\njangan menyulitkan mahasiswa'),('20131','Ruang BAA, sering dikunci jadi saya terpaksa menunggu. organisasi kemahasiswaan kurang teroganisir\r\n'),('20131','harus ta??'),('20131','pada pelayanan, BAA kurang bisa bersatu. saya pernah mengalami hal yang ganjil ketika saya membayar uang sks secara tunai melalui BAA lantai 1, BAA lantai 1 tidak bisa menerima pembayaran melalui tunai dan menyarankan untuk BAA lantai 2. itu membuat saya bingung sama - sama BAA tapi kok tidak bersatu dan anehnya ketika saya sudah selesai membayar di lantai 2, saya disarankan untuk mensahkan pembayaran di BAA lantai 1. Hal itu membuat saya merasa ganjil pada BAA'),('20131','BAU bawa sudah berubah, bukan tmpt bayar uang kmpus lagi, namun tmpt cangkrungan!\r\nKadang jga d tanya d blg ga ada, tpi teman saya, bisa bayar pada hri yg sama, ternyata orgnya lagi k blkg, dan akhirnya saya kena denda, karna bayar telat!'),('20131','BAU bawa sudah berubah, bukan tmpt bayar uang kmpus lagi, namun tmpt cangkrungan!\r\nKadang jga d tanya d blg ga ada, tpi teman saya, bisa bayar pada hri yg sama, ternyata orgnya lagi k blkg, dan akhirnya saya kena denda, karna bayar telat!'),('20131','BAU bawa sudah berubah, bukan tmpt bayar uang kmpus lagi, namun tmpt cangkrungan!\r\nKadang jga d tanya d blg ga ada, tpi teman saya, bisa bayar pada hri yg sama, ternyata orgnya lagi k blkg, dan akhirnya saya kena denda, karna bayar telat!'),('20131','kebersihan wc kurang, fasilitas juga masih kurang, wifi susah diakses'),('20131','Respon Email kurang responsive, lambat dalam pelayanan.'),('20131','-Siswa kelas malam jarang bisa menikmati fasilitas kampus (non formal) seperti perpustakaan, lapangan indoor,auditorium, dll\r\n-Susah untuk mengikuti UKM'),('20131','tidak ada'),('20131','semuanya sangat baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','Sudah cukup baik'),('20131','sudah sangat bagus, dan berguna'),('20131','Perpustakaan sebaiknya jam malam bisa di buka untuk mahasiswa yang sedang bekerja bisa mengunjungi perpustakaan'),('20131','B'),('20131','- koneksi wi-fi kurang\r\n- Toilet di gedung E airnya serig mati\r\n- tidak adanya ruang karya untuk jurusan S1 DKV\r\n- lab DKV yg kurang komputer (fasilitas)'),('20131','Pra sarana untuk mahasiswa DKV kurang maksimal, gedung b100 (depannya) seharusnya dpt dimaksimalkan dengan di mural agar nuansa DKV nya lebih dapat dan jg agar jika ada tim pengawas mengenai DKV tidak malu malui dikarenakan tdk adanya nuansa DKV atau art itu sendiri '),('20131','perpustakaan gedung b kurang sinyal wifinya kurang baik... '),('20131','Pelayanannya sudah cukup baik, orang yang melayani juga ramah tamah'),('20131','Poin mahasiswa terlalu lama muncul di SIM dari tanggal kegiatan dilaksanakan. Nilai beberapa mata kuliah juga tidak kunjung muncul sampai dengan semester berikutnya berjalan, perlu ada tanggal deadline yang jelas kapan nilai semua mata kuliah akan muncul di SIM. '),('20131','mohon email masuk di balas.'),('20131','Datanya berantakan semua. yang betul yang mana'),('20131','Kamar mandi wanita di lorong menuju B terdapat 2 bilik yang toiletnya tidak bisa diflush. Mengingat kamar mandi ini merupakan kamar mandi di tengah kampus yang sering dipakai, mohon diperhatikan kelayakannya. Terima kasih banyak.'),('20131','tidak ada'),('20131','Sering kali terjadi kesalahan dalam pendataan nilai.\r\nSering kali saya merasa jenuh karena asisten lab yang kurang berkompeten.'),('20131','Pengecekan pembayaran uang semester kurang teliti'),('20131','o'),('20131','Mohon ditingkatkan pada bagian keuangan (khususnya bagian beasiswa) karena sering terjadi keterlambatan sehingga sering terjadi kelebihan pendebitan uang sekolah.\r\n\r\nPada saat ini, uang sekolah saya belum juga didebit, padahal saldo saya masih mencukupi dan dikarenakan beasiswa belum turun, mohon segera dilakukan tindakan.\r\n\r\nMohon untuk dipertimbangkan agar masing-masing lab memiliki kepala lab yang berbeda, agar dosen tersebut dapat lebih fokus dan lab dapat dieksplor lebih banyak (mengingat praktikum sangat penting, selain hanya teori saja).'),('20131','Pemberian beasiswa tidak pernah tepat waktu sehingga penarikan uang kuliah selalu kelebihan dari yang seharusnya. Jika tanya ke ibu BAU bawah jawabannya selalu \"ya tidak apa-apa kan, buat semester depan aja, kan kamu masih kuliah di sini\". Iya kalau saya masih melanjutkan STTS, kalau tidak butuh ngurus lagi ngurus lagi. Yang diambil kelebihan adalah uang jajan saya, jadi saya tidak makan karena ngutangi kampus? Masa iya mama saya harus memberi uang jajan lagi karena diambil kampus? Pendebetan Februari 2014 kemarin, tabungan saya tidak didebet karena katanya beasiswa belum selesai diurus. Saya mengurus beasiswa sejak masuk awal kuliah bulan September 2013 dan belum selesai diurus hingga Februari 2014. Itu sudah 6 BULAN!! Padahal beasiswa saya ini pasti, beasiswa PMB elektro putri dengan syarat IP di atas 3. Hal ini kan sudah bisa dipastikan sejak nilai keluar. Seharusnya beasiswanya sudah bisa langsung dikeluarkan. Saya belajar keras mengejar beasiswa membantu orang tua, itu kan hak saya. Mana kewajiban kampus memberikan beasiswa? Kalau telat bayar saja asiknya main denda, kalau main denda aja tepat waktu sekali tapi kalau kewajiban memberi beasiswanya NOL BESAR! Saya tanya ibu BAU ternyata kemahasiswaan yang belum mengeluarkan beasiswa. Saya tanya kemahasiswaan ternyata mereka semua sibuk mengurus PMB. Apa sistemnya STTS itu kalau mahasiswa sudah masuk ya sudah tidak diurus, jadi prioritas terakhir? Prioritas utama adalah mencari mahasiswa baru terus? Jika tidak tulus memberi beasiswa, ya dari awal jangan digembor-gemborkan begitu lho. Hal ini sudah terulang sejak saya semester 2 hingga saya semester 5, sudah 2 TAHUN tidak ada pembenaran sama sekali. Sangat mengecewakan!'),('20131','Kantin dan b100 kurang nyaman tidak seperti layaknya kampus'),('20131','tak ada'),('20131','* modul sebagai pegangan mahasiswa untuk kelas malam dari semester awal sampai semester akhir tidak sampai kepada mahasiswa. apakah ada modul pegangan bahan belajar atau materi untuk mahasiswa.'),('20131','baik'),('20131','tidak ada'),('20131','mahasiswa dkv butuh tempat untuk menaruh karya.'),('20131','Pelayanannya sudah bagus, semoga ditingkatkan lagi...'),('20131','Belum ada'),('20131','untuk administrasi dan pencatan pembayaran diperbaiki lagi'),('20131','TIDAK ADA'),('20131','tolong kebersihan tetap dijaga'),('20131','kotor, tidak terawat fasilitasnya'),('20131','untuk pengumuman pembatln matkul dimading yg suka telat dan bahkan pernah 1 jam sblm matkul dislngrrkan bru dipanjang..'),('20131','perpusnya kok tidak berkembang. malu ah bukunya lama2, buku luar gak ada. sains terapan itu berkembang. kalau cara masak nasi jarang berkembangnya. materi di buku tidak selalu ada di inet. pakai saja denda perpus selama ini.\r\n\r\nbeli barang2 buat mikro2. susah kalau muridnya sendiri yang beli, trus buat muridnya sendiri. akhirnya tidak terpakai karena murid tdk punya arduinonya, kampus punya arduinonya tpi tidak punya modul dan alat2 lainnya. lak bodo lek sistem kayak gini. stts kalau mau beli modul2 yang sudah murid2 beli.\r\n\r\nbelilah tanah sekitar biar stts kelihatan lebih bagus, terlihat dari luar, dan gak kalah dengan sekolah lain. dulu cukup dengan luas tanah segini tapi sekarang tidak.'),('20131','Terlalu ramai dan membuat sungkan mahasiswa untuk masuk.'),('20131','Staf perpusnya jangan galak-galak mukanya, mhs jdi males pinjem buku..'),('20131','tidak ada'),('20131','Untuk Lab Komputer > Tidak semua komputer berjalan dengan baik pada saat proses Belajar Mengajar\r\nUntuk BAA > Sejauh saya kuliah (masih 1 semester) keberadaan BAA dalam tengah lingkungan siswa masih belum terlihat, jadi saya merasa kurang begitu kenal dengan BAA'),('20131','semoga bisa lebih berkembang kedepan nya jadi lebih baik lg.'),('20131','Di tingkatkan lagi'),('20131','Toilet gedung E air sering mati\r\nTidak ada fasilitas ruang karya untuk jurusan S1 DKV\r\nKomputer lab DKV kurang memadai\r\nSpot wi-fi kurang'),('20131','BAA Atas\r\n* Cek setiap pengumpulan dokumen yang ada dengan teliti terlebih dahulu.\r\n* Jadwal yang ada terkadang tidak terealisasi (mundur)\r\n\r\n'),('20131','Gedung B yang sering bocor, toilet gedung E kurang terurus'),('20131','Untuk BAA lantai atas mungkin untuk kaca yang membatasi antara petugas dengan mahasiswa kurang nyaman, karena kaca yang ada lubang nya terlalu rendah.'),('20131','Wifi kurang'),('20131','alangkah baiknya lebih ramah. terima kasih'),('20131','Air di lantai 2 sering mati ketika kuliah minggu'),('20131','Kabel2 di e lib di rapikan. Sayang. Tempat udah bagus tp ndak rapi. '),('20131','Perpustakaan terkesan monoton, kurang hidup.'),('20131','Fasilitas krg memadai'),('20131','Wifiinya minta ditingkatkan speednya dan di tiap ruangan memiliki wifii sendiri untuk kepentingan proses belajar mengajar serta untuk mencari materi dan bahan perkuliahan dengan lancar dan baik,serta di B100 mohon ditambah alat penguat sinyal'),('20131','nothing'),('20131','lahan parkir krng luas..\r\n'),('20132','Butuh koneksi internet yang lebih cepat.\r\nKoneksi internet yang cepat dan stabil telah dijanjikan sejak lama, tapi realisasinya sampai saat ini tidak pernah ada.\r\nMohon diperhatikan.'),('20132','Internet masih lambat dan putus-putus'),('20132'