ain proyek masing2 anak.  Terlalu bergantung dgn arduino,  sdikit2 arduino,  cari yg gampang bkn yg byk dipk dlm dunia kerja. Soal uas bknlah soal yg bisa diselesaikan dlm 2 jam krn soal yg terlalu rumit. '),('20132','EP701','Kerja Praktek','D098','Setya Ardhi','211102519','NATALIA TJOKROBUDIANTO','Dosen elektro habis..  Sangat kekurangan dosen. Sehingga yg kurang sehat pun terpaksa mengajar dan beberapa dosen hrs mengajar hal yg bkn dikuasainya sehingga krg menguasai dan krg enk mengajarnya. '),('20132','EN605','Teknik Audio dan Video','D005','Agus Djaja Gunawan','211102519','NATALIA TJOKROBUDIANTO','Fasilitas kampus krg memadai untuk pelajaran ini.Dosen elektro habis..  Sangat kekurangan dosen.  Sehingga dosen yg krg sehat pun terpaksa mengajar dan bbrp dosen terpaksa mengajari hal yg bkn dikuasainya shg kurang enk mengajarnya dan tdk menguasai materi. '),('20132','EN604','Sistem Telekomunikasi','D005','Agus Djaja Gunawan','211102519','NATALIA TJOKROBUDIANTO','Dosen elektro habis..  Sangat kekurangan dosen.  Sehingga dosen yg krg sehat pun terpaksa mengajar dan bbrp dosen terpaksa mengajari hal yg bkn dikuasainya shg kurang enk mengajarnya dan tdk menguasai materi. '),('20132','FN205','Matematika 1','D160','','213116230','IVANDER WILSON SOENJOYO','Soal-soal UTS dan UAS banyak variasi. Tetapi latihannya kurang bervariasi'),('20132','IN221','Human Computer Interaction','D029','Suhatati Tjandra','213210397','MAULIDI','kurang praktek'),('20132','IN220','Internetworking Technology','D007','F.X. Ferdinandus','213210397','MAULIDI','kurang praktek'),('20132','IN219','Digital Image Processing and Computer Vision','D017','Endang Setyati','213210397','MAULIDI','Sering dapat tugas dari stts dan tidak masuk ngajar. Walaupun diganti di waktu lain, tpi waktunya tidak kondusif'),('20132','IN224','Machine Learning','D089','Yosi Kristian','213210397','MAULIDI','Perlu ngajar dari awal, karena banyak mahasiswa yg tidak paham dari awal'),('20132','FN406','Pengolahan Citra Digital','D0