a dihandle oleh direkturnya langsung di perusahaan tempat sy berkerja ini, beliau sangat sulit untuk ditemui. Sehingga progres kerja kami bisa dikatakan kebut2an.. Karena sekali ketemu, lgsg membicarakan banyak hal. Namun dosen menuntut untuk laporan tiap minggu nya, sedangkan kami laporan itu 3 minggu sekali.. Namun lgsg ada hasil nya.. Karena kami pernah ditegur karna jarang konsul, akhirnya kami tiap minggu nya memberikan progress kami apa adanya. Dan hasilnya kami ditegur kembali karna dianggap bermain2 dan tidak serius dalam membuat buku (saat itu progress buku). Padahal kami sudah berusaha memberikan progress kami..\r\n- Dari sana kami belajar untuk memberikan yang perfect dan takut untuk memberikan yg masih salah.. Akhirnya ketika hari terakhir konsul buku (sebelum uas), kami terlambat konsul karna kami menemukan beberapa kesalahan format yang tidak diduga.. Karena banyak kelompok yang belum selesai, akhirnya hari itu satu angkatan terlambat masuk kelas.. Dosen pun marah besar terhadap kami seangkatan,  kami sudah berusaha untuk menjelaskan alasan mengapa kami terlambat (alasan saya karena sy sedang memperbaiki buku.. Dan juga kalau di mata kuliah lain, kalau mau maju proyek, dosennya memperbolehkan kami untuk maju kapanpun asalkan pada hari itu kecuali ada presentasi di depan teman2).. Padahal dosen sendiri juga pernah terlambat dalam mengajar..\r\n\r\nSaya tidak tau apakah saya bisa lulus atau tidak dalam mata kuliah ini.. Namun apapun hasil nya, saya mengucapkan terimakasih atas jasa beliau.. Semoga di semester kedepannya mata kuliah ini bisa diberikan dosen yang memiliki waktu cukup longgar dalam memberikan konsul kepada mahasiswa karena tidak semua perusahaan mudah ditemui per minggunya.. Apalagi kalau kita berhubungan dengan direkturnya langsung.. Mereka sangat sibuk dalam berpergian keluar kota..\r\nTrimakasih'),('20142','SN621','Technopreneurship 1','D099','Jonie Hermanto','213180286','JEREMIAH IRAWAN H','Ketepatan waktu ditingkatkan lagi'),('','SB601