alu baik. Hal ini dikarenakan semua penjelasan teori mengenai pelajaran ini sudah terdapat di slide dan tidak ada penjelasan lanjut untuk membuka wawasan mahasiswa. Bahan ujiannya pun (walaupun teori) hanya terpaut dalam penjelasan di slide. Selain itu, bu grace juga perlu untuk lebih tegas dalam mengajar sehingga selain mahasiswa bisa lebih mengerti, mahasiswa juga bisa lebih memperhatikan bu grace.'),('20151','FN304','Analisa dan Desain Sistem','D007','F.X. Ferdinandus','214116296','BERNARD NIKLAS SATRIJO','Menurut saya, pak ferdi mempunyai cara mengajar yang baik. Cara menjelaskannya tidak bertele-tele dan tepat. Menurut saya yang kurang, mungkin suara pak ferdi dalam mengajar di ruang yang besar kurang. Mengenai keterlambatan pak ferdi kadang-kadang, hal itu masih bisa dimengerti mahasiswa karena jabatan pak ferdi yang membuat pak ferdi lebih sibuk dari dosen lain.'),('20151','FN236','Logika Matematika','D031','Tjwanda Putera Gunawan','214116296','BERNARD NIKLAS SATRIJO','Menurut saya, pak Tjwanda sudah mengajarkan materi dan menjadi dosen yang baik. Dalam kelas, pengajaran sudah cukup bebas, tetap dengan suara yang terkontrol, dan cara mengajarnya pun cukup baik. Saya belum menemukan kekurangan dari matkul Logika Matematika yang diajarkan pak Tjwanda ini.'),('20151','FN303','Pengembangan Aplikasi Internet','D171','Kristian Indradiarta Gunawan','214116296','BERNARD NIKLAS SATRIJO','Menurut saya, pak Indra kekurangannya berada di penyampaian wawasan materi yang kurang luas. Penyampaian hanya sesuai slide dan tidak ada tambahan penjelasan sehingga bagi mahasiswa terkadang belum jelas. Walaupun begitu, materi dan tugas yang disampaikan pak Indra sudah cukup untuk merangkum materi pada pelajaran di hari itu. Kedisiplinan dalam kelas Aplin pak Indra juga sudah baik.'),('20151','FN302','Pemrograman Berorientasi Objek','D100','Esther Irawati Setiawan','214116296','BERNARD NIKLAS SATRIJO','Bu Esther sudah memberikan pengajaran dengan cukup baik. Caranya menyampaikan materi dengan pelan membuat mahasiswa dapat cukup mengerti pelajaran karena progress yang tidak terlampau cepat. Mungkin yang kurang dari kelas bu Esther adalah pengontrolan suara dalam kelas, sehingga seringkali kelas terlalu ribut sendiri, dan mahasiswa yang mau memperhatikan tidak bisa memperhatikan dengan baik karena ributnya kelas.'),('20151','FN702','Teknik Kompilasi','D136','Reddy Alexandro Harianto','212116113','JONATHAN HALIM S','Dosen rapenak blassss'),('20151','MT302','Proyek Pemrograman Visual','D176','Kevin Setiono','214011643','MATIAS KURNIAHARTANTO','koneksi database mysql ke program visual studio tidak ada'),('20151','MN342','Accounting Information System','D029','Suhatati Tjandra','214011643','MATIAS KURNIAHARTANTO','soal latihan kurang'),('20151','FN306','Matematika 2','D004','Oswald Baskoro Satyoadi','213116242','MAEZTRO DASSE ARDHAN','Kelasnya sangat ramai '),('20151','FB102','Bahasa Indonesia','L167','','215116485','TIMOTHIUS TIRTAWAN','jangan terlalu sering terlambat bu'),('20151','FN107','Algoritma dan Pemrograman 1','D111','C. Pickerling','215116479','SETIAWAN DJORDI','dosen datangnya sangat telat'),('20151','IN117','Multimedia Data Processing','D056','Lukman Zaman P. C. S. W.','215210478','HERY DWI KRISTIONO','kalau ngajar jangan cepet cepet pak'),('20151','SN103','Pengantar Bisnis','D099','Jonie Hermanto','215180351','BENYAMIN LIMANTO','Pak ada yang saya sayangkan itu kita gagal menjalankan proyek jual barang online, saya ingin pak menimba ilmu itu... '),('20151','SA117','Agama Kristen','L166','','215180345','ABRAHAM WILLIAM PUDJIONO','cara mengajarnya masih kurang enak'),('20151','FA112','Agama Katolik','L018','John Tondowidjojo','215116436','FELIX ADRIAN','Kalau ada TBU, Romo pasti TBU Absen\r\nPenilaian benar-benar tidak objektif'),('20151','SN104','Sistem Informasi Manajemen','D029','Suhatati Tjandra','215180345','ABRAHAM WILLIAM PUDJIONO','kalau mengajar terlalu lembut suaranya'),('20151','IN115','Knowledge Discovery in Database','D013','